.','Isolated'),(888,'2022-11-21 01:32:54','2022-11-21 01:32:54','Lever Neck Flexion','Pull','https://exrx.net/WeightExercises/Sternocleidomastoid/LVNeckFlx','Move head forward by flexing neck until chin touches upper chest. Return head by hyperextending neck and repeat.','Isolated'),(889,'2022-11-21 01:32:54','2022-11-21 01:32:54','Lever Lateral Neck Flexion','Pull','https://exrx.net/WeightExercises/Sternocleidomastoid/LVNeckLtrFlx','Move head down to side by laterally flexing neck. Return head to opposite side and repeat. Sit in machine backwards and continue with opposite side.','Isolated'),(890,'2022-11-21 01:32:54','2022-11-21 01:32:54','Weighted Lying Neck Flexion','Pull','https://exrx.net/WeightExercises/Sternocleidomastoid/WtLyingNeckFlexion','Move head up by flexing neck until chin touches upper chest. Return by hyperextending neck and repeat.','Isolated'),(891,'2022-11-21 01:32:54','2022-11-21 01:32:54','Weighted Neck Flexion','Pull','https://exrx.net/WeightExercises/Sternocleidomastoid/WtNeckFlx','Move head up by flexing neck until chin touches upper chest. Return by hyperextending neck and repeat.','Isolated'),(892,'2022-11-21 01:32:54','2022-11-21 01:32:54','Weighted Lateral Neck Flexion','Pull','https://exrx.net/WeightExercises/Sternocleidomastoid/WtNeckLateralFlex','Move head up to side by laterally flexing neck. Lower head to opposite side and repeat. Lie on other side and continue.','Isolated'),(893,'2022-11-21 01:32:54','2022-11-21 01:32:54','Front Neck Bridge','Push','https://exrx.net/WeightExercises/Sternocleidomastoid/BWFrontNeckBridge','Roll back onto forehead until nose touches mat. Roll forward onto top of head until chin touches upper chest. Repeat.','Isolated'),(894,'2022-11-21 01:32:54','2022-11-21 01:32:54','Wall Front Neck Bridge','Push','https://exrx.net/WeightExercises/Sternocleidomastoid/BWWallFrontNeckBridge','Roll down onto forehead until nose touches mat. Roll up onto top of head until chin touches upper chest. Repeat.','Isolated'),