end knees and hips until legs are straight. Return and repeat.','Compound'),(2091,'2022-11-21 01:33:48','2022-11-21 01:33:48','Lever Front Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVFrontSquatPL','Lower lever by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Lift lever up by extending knees and hips until legs are straight. Repeat.','Compound'),(2092,'2022-11-21 01:33:48','2022-11-21 01:33:48','Lever Full Squat (plate loaded)','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVFullSquatPL','Squat down by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until knees and hips are fully bent. Lift lever up by extending knees and hips until legs are straight. Repeat.','Compound'),(2093,'2022-11-21 01:33:48','2022-11-21 01:33:48','Lever Hack Squat (plate loaded)','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVHackSquat','Lower lever by bending hips and knees, until knees are just short of complete flexion. Raise sled by extending knees and hips. Repeat.','Compound'),(2094,'2022-11-21 01:33:48','2022-11-21 01:33:48','Lever V-Squat (plate loaded)','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVVSquatH','Bend knees forward slightly while allowing hips to bend back behind, keeping back straight and knees pointed same direction as feet. Descend until hips are just short of complete flexion. Raise sled by extending knees and hips. Repeat.','Compound'),(2095,'2022-11-21 01:33:48','2022-11-21 01:33:48','Lever Bent-over Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVBentOverHipExtension','Push foot lever back by extending hip. Return leg to original position. Repeat. Reposition and continue with opposite leg.','Isolated'),(2096,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Kneeling Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVKneelingHipExtensionRoller','Keeping one leg on shin pad, extend hip of other leg and push roller pad back. Raise roller pad up until hip is completely extended. Return leg to original position and repeat. Continue with opposite leg.','Isolated'),(2097,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Alternating Kneeling Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVAlternatingKneelingHipExtRoll','Keeping one leg on shin pad, extending hip of other leg and push roller pad back. Raise roller pad up until hip is completely extended. Return leg to original position. Repeat with opposite leg. Continue alternating between each side.','Isolated'),(2098,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Lying Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVLyingHipExtension','Push padded leg bar down until hips are extended. Return and repeat.','Isolated'),(2099,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Alternating Lying Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVAlternatingLyingHipExtension','Raise one knee by flexing hip. Return to original position by extending hip. Repeat with opposite leg, alternating between sides.','Isolated'),(2100,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Standing Hip Extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVStandingHipExtension','Lower lever by extending hip. Return until knee is higher than hip. Repeat. Continue with opposite leg.','Isolated'),(2101,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Standing Hip Extension (with abdominal pad)','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVStandingHipExtensionTech','Extend lever back by extending hip and straightening leg. Return by flexing hip and knee. Repeat. Continue with opposite leg.','Isolated'),(2102,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Alternating Lying Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVAlternatingLyingLegPress','Lower one lever platform toward body by bending knee and hip until weight taps or nearly taps unused portion of weight stack. Push lever platform away by extending knee and hip. Repeat with opposite leg. Continue by alternating between sides.','Compound'),(2103,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Seated Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSeatedLegPress','Extend knees and hips until knees are fully extended. Return until hips are completely flexed. Repeat.','Compound'),(2104,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Single Leg Seated Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSingleLegLegPress','Push platform away by extending hip and knee. Return by bending leg until knee or hip is just short of complete flexion. Repeat. Continue with opposite leg.','Compound'),(2105,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Bent-over Glute Kickback','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVBentOverRearKick','Push platform or pedal back by extending leg. Return leg to original position. Repeat. Continue with opposite leg.','Compound'),(2106,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Kneeling Glute Kickback','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVKneelingHipExtension','Push platform back by extending leg back. Return leg to original position and repeat. Continue with opposite leg.','Compound'),(2107,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Standing Glute Kickback','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSingleLegStandingLegPress','Push platform down by extending leg until straight. Return leg to original position. Repeat. Continue with opposite leg positions.','Compound'),(2108,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSquat','Raise lever up by extending knees and hips until legs are straight. Squat down by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Return and repeat.','Compound'),(2109,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever V-Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVVSquat','Raise lever by extending knees and hips until legs are straight. Squat down with knees pointed same direction as feet. Descend until knees or hips are near complete flexion. Repeat.','Compound'),(2110,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Split V-Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSingleLegVSquat','Squat down with knee pointed same direction as foot. Allow leg to bend behind with forefoot on floor. Descend until forward hip is near complete flexion. Raise sled by extending knee and hip until leg is straight. Repeat. Continue with other leg.','Compound'),(2111,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Single Leg Split V-Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVSingleLegSplitVSquat','Raise lever by extending knees and hips. Lower lever by flexing hips and knees until knee of rear leg is almost in contact with floor. Repeat. Continue with opposite leg positions.','Compound'),(2112,'2022-11-21 01:33:49','2022-11-21 01:33:49','Lever Alternating Single Leg Split V-Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/LVAlternatingSingleLegSplitVSquat','Transfer right foot back to inside of rear vertical platform. Lower lever by flexing hips and knees until knee of rear leg is almost in contact with floor. Raise lever by extending knees and hips until knee is straight. Return right foot to original position by other foot. Repeat with opposite leg movement and continue alternating between sides.','Compound'),(2113,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled 45° Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/SL45LegPress','Lower sled by flexing hips and knees until knees are just short of complete flexion or until hips are completely flexed. Return by extending knees and hips. Repeat.','Compound'),(2114,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Alternating 45° Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLAlternating45LegPress','Lower one platform toward body by bending knee and hip until knees are just short of complete flexion or until hips are completely flexed. Push platform away by extending knee and hip. Repeat with opposite leg. Continue by alternating between sides.','Compound'),(2115,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Single Leg 45° Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLSingleLeg45LegPress','Lower sled by bending leg until knee is just short of complete flexion. Return by extending knee and hip. Repeat. Continue with opposite leg.','Compound'),(2116,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Hack Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLHackPress','Lower sled by flexing hips and knees until either is near complete flexion. Raise sled by extending knees and hips. Repeat.','Compound'),(2117,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Lying Leg Press','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLLyingLegPress','Extend hips and knees. Return until hips are completely flexed. Repeat.','Compound'),(2118,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Lying Leg Press (plate loaded)','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLLyingLegPressPL','Bring sled toward platform by flexing hips and knees until knees are just short of complete flexion or until hips are completely flexed. Return by extending knees and hips. Repeat.','Compound'),(2119,'2022-11-21 01:33:49','2022-11-21 01:33:49','Sled Single Leg Lying Leg Press (plate loaded)','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLSingleLeg