anding Glute Kickback','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLStandingHipExtension','Push platform back by extending leg back until straight. Return leg to original position. Repeat. Continue with opposite leg.','Compound'),(2126,'2022-11-21 01:33:50','2022-11-21 01:33:50','Sled Rear Lunge','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLRearLunge','Step back with one leg while bending supporting leg. Plant forefoot far back on floor. Lower body by flexing knee and hip of supporting leg until knee of rear leg is almost in contact with floor. Return to original standing position by extending hip and knee of forward supporting leg and return rear leg next to supporting leg. Repeat movement with opposite legs, alternating between sides.','Compound'),(2127,'2022-11-21 01:33:50','2022-11-21 01:33:50','Sled Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLSquat','If hand or lever lock is available, disengage weight, squat to lowest position and re-engage lock. Lift sled by extending knees and hips until legs are straight. Lower sled by bending knees forward slightly while allowing hips to bend back behind, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Return and repeat.','Compound'),(2128,'2022-11-21 01:33:50','2022-11-21 01:33:50','Sled Hack Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLHackSquat','Lower sled by flexing hips and knees until hips are completely flexed. Raise sled by extending knees and hips. Repeat.','Compound'),(2129,'2022-11-21 01:33:50','2022-11-21 01:33:50','Sled Single Leg Hack Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SLSingleLegHackSquat','Lower sled by flexing hips and knee of supporting leg until knees are just short of complete flexion. Raise sled by extending knee and hips. Repeat. Continue with opposite leg.','Compound'),(2130,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Bent Knee Good-morning',NULL,'https://exrx.net/WeightExercises/GluteusMaximus/SMBentKneeGoodMorning',NULL,'Bend hips to lower torso forward until parallel to floor. Bend knees slightly during descent. Raise torso until hips are extended. Repeat.'),(2131,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Deadlift','Pull','https://exrx.net/WeightExercises/GluteusMaximus/SMDeadlift','Return weight toward floor by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Lift bar by extending hips and knees to full extension. Pull shoulders back at top of lift if rounded. Return and repeat.','Compound'),(2132,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Stiff Leg Deadlift','Pull','https://exrx.net/WeightExercises/GluteusMaximus/SMStiffLegDeadlift','With knees slightly bent, lower bar toward top of feet by bending hips. Keep waist straight, flexing only slightly at bottom. Lift bar by extending at hips until standing upright. Pull shoulders back slightly if rounded. Extend knees at top if desired. Repeat.','Compound'),(2133,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Straight-back Stiff-leg Deadlift','Pull','https://exrx.net/WeightExercises/GluteusMaximus/SMStrBackStiffLegDeadlift','With knees bent, lower bar toward top feet by bending hips and keeping waist straight. Lift bar by extending at hips until standing upright. Pull shoulders back slightly if rounded. Extend knees at top if desired. Repeat.','Isolated'),(2134,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Rear Lunge','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMRearLunge','Step back with one leg while bending supporting leg. Plant forefoot far back on floor. Lower body by flexing knee and hip of supporting leg until knee of rear leg is almost in contact with floor. Return to original standing position by extending hip and knee of forward supporting leg and return rear leg next to supporting leg. Repeat movement with opposite legs, alternating between sides.','Compound'),(2135,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Single Leg Split Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMSingleLegSplitSquat','Lower body by flexing knee and hip of front leg until knee of rear leg is almost in contact with floor. Return to original standing position by extending hip and knee of forward leg. Repeat. Continue with opposite leg.','Compound'),(2136,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Split Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMSplitSquat','Lower body on other leg by flexing knees and hips of both legs until knee of rear leg is almost in contact with floor. Return to original straddled position by extending hips and knees of both legs. Repeat. Continue with opposite leg.','Compound'),(2137,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMSquat','Squat down by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Extend knees and hips until legs are straight. Return and repeat.','Compound'),(2138,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Single Leg Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMSingleLegSquat','Bend knee slightly forward while allowing hips to bend, keeping back straight and knee pointed same direction of foot. Descend until thigh of supporting leg is just past parallel to floor. Extend knee and hip until leg is straight. Return and repeat.','Compound'),(2139,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Front Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMFrontSquat','Squat down by bending hips back while allowing knees to bend forward , keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Extend knees and hips until legs are straight. Return and repeat.','Compound'),(2140,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Hack Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMHackSquat','Squat down by bending knees forward while allowing hips to bend back behind, keeping back straight and knees pointed same direction as feet. Descend until thighs are too close to parallel to floor and bar is behind lower leg. Lift bar by extending hips and knees to full extension. Repeat.','Compound'),(2141,'2022-11-21 01:33:50','2022-11-21 01:33:50','Smith Wide Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/SMWideSquat','Squat down by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Extend knees and hips until legs are straight. Return and repeat.','Compound'),(2142,'2022-11-21 01:33:50','2022-11-21 01:33:50','Weighted Belt Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/WtSquat','Squat down by bending hips back while allowing knees to bend forward slightly, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Squat up by extending knees and hips until legs are straight. Return and repeat.','Compound'),(2143,'2022-11-21 01:33:50','2022-11-21 01:33:50','Weighted Front Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/WTFrontSquat','Squat down by bending hips back while allowing knees to bend forward, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Extend knees and hips until legs are straight. Return and repeat.','Compound'),(2144,'2022-11-21 01:33:50','2022-11-21 01:33:50','Weighted Reverse Hyper-extension','Push','https://exrx.net/WeightExercises/GluteusMaximus/WtReverseHyperextension','Raise weight by extending hips as high as possible until legs are nearly straight. Lower legs to original position. Repeat.','Isolated'),(2145,'2022-11-21 01:33:51','2022-11-21 01:33:51','Weighted Single Leg Squat','Push','https://exrx.net/WeightExercises/GluteusMaximus/WtSingleLegSquat','Squat down as far as possible while keeping leg elevated off of floor. Keep supporting knee pointed same direction as foot supporting. Raise body back up to original position until knee and hip of supporting leg is straight. Return and repeat. Continue with opposite leg.','Compound'),(2146,'2022-11-21 01:33:51','2022-11-21 01:33:51','Kettlebell Front Squat','Push','https://exrx.net/WeightExercises/Kettlebell/KBFrontSquat','Bend knees slightly forward while allowing hips to bend back behind, keeping back taut and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Extend knees and hips until legs are straight. Return and repeat.','Compound'),(2147,'2022-11-21 01:33:51','2022-11-21 01:33:51','Kettlebell Overhead Split Squat','Push','https://exrx.net/WeightExercises/Kettlebell/KBOverheadSplitSquat','Squat down by flexing knee and hip of front leg. Allow heel of rear foot to rise up while knee of rear leg bends slightly, until it almost makes contact with floor. Return to original standing position by extending hip and knee of forward leg. Repeat. Clean and Jerk weight with opposite arm and squat with other leg forward.','Compound'),(2148,'2022-11-21 01:33:51','2022-11-21 01:33:51','Kettlebell Overhead Rear Lunge','Push','https://exrx.net/WeightExercises/Kettlebell/KBOverheadRearLunge','Step back with leg on opposite side of kettlebell while bending supporting leg. Plant forefoot far back on floor. Lower body by flexing knee and hip of supporting leg until knee of rear leg is almost in contact with floor. Return to original standing position by extending hip and knee of forward supporting leg and return rear leg next to supporting leg. Repeat. Clean and Jerk weight with opposite arm and lunge on other leg.','Compound'),(2