 are almost fully flexed or near floor. Return to original position by extending knees as heels return to floor.','Isolated'),(2434,'2022-11-21 01:34:07','2022-11-21 01:34:07','Sissy Squat (on apparatus)','Push','https://exrx.net/WeightExercises/Quadriceps/BWSissySquatAp','Allow body to fall backwards by bending knees. During descent, gradually bend hips, yet keep chest high and don\'t allow torso to angle forward. Lower body until back of thigh is against upper pad. Rise to original position by extending knees and hips while keeping shoulders behind hips. Repeat.','Isolated'),(2435,'2022-11-21 01:34:07','2022-11-21 01:34:07','Split Squat','Push','https://exrx.net/WeightExercises/Quadriceps/BWSplitSquat','Squat down by flexing knee and hip of front leg. Allow heel of rear foot to rise up while knee of rear leg bends slightly until it almost makes contact with floor. Return to original standing position by extending hip and knee of forward leg. Repeat. Continue with opposite leg.','Compound'),(2436,'2022-11-21 01:34:07','2022-11-21 01:34:07','Single Leg Split Squat','Push','https://exrx.net/WeightExercises/Quadriceps/BWSingleLegSplitSquat','Squat down by flexing knee and hip of front leg until knee of rear leg is almost in contact with floor. Return to original standing position by extending hip and knee of forward leg and repeat. Continue with opposite leg.','Compound'),(2437,'2022-11-21 01:34:07','2022-11-21 01:34:07','Squat','Push','https://exrx.net/WeightExercises/Quadriceps/BWSquat','Squat down by bending hips back while allowing knees to bend forward, keeping back straight and knees pointed same direction as feet. Descend until thighs are just past parallel to floor. Squat up by extending knees and hips until legs are straight. Return and repeat.','Compound'),(2438,'2022-11-21 01:34:07','2022-11-21 01:34:07','Half Squat','Push','https://exrx.net/WeightExercises/Quadriceps/BWHalfSquat','Squat down by bending hips back while allowing knees to bend forward, keepin